  false,\n\t\"url\": null,\n\t\"notes\": \"The Light Detection and Ranging (LiDAR)
  dataset is a survey of the Atchafalaya Basin in south-central Louisiana. The entire
  survey area encompasses 981 square miles. The LiDAR point cloud was flown at a nominal
  post spacing of 1.0 meters for unobscured areas. The LiDAR data is in compliance
  with the U.S. Geological Survey National Geospatial Program Guidelines and Base
  Specifications, Version 13-ILMF 2010. The Flightlines were acquired by Northrop
  Grumman, 3001 Operating Unit, which required 10 subsequent missions between December
  2, 2010, and December 7, 2010. Northrop Grumman classified the data into the following
  ASPRS compliant classes: Class 1: Processed, but unclassified Class 2: Bare Earth
  Ground Class 3: Low Vegetation Class 4: Medium Vegetation (also used for manual
  classification of vegetation returns) Class 5: High Vegetation Class 6: Buildings
  and man-made structures Class 7: Noise (low or high, manually identified) Class
  9: Water Class 10: Ignored Ground (Breakline Proximity) Class 13: Withheld (outliers,
  blunders, etc.)\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
